import React, { Component } from 'react';
import data from './data.json';

var stock = JSON.parse(data.product_stock);

class App extends Component {
  render() {
    return (
      <div className="App">
        <table border="1">
                <thead>
                    <tr>
                {
                    data.location.map((data, j) => {
                        return(


                                        <th key={j}>{data.name}</th>


                        )
                    })
                }
                        <th>Description</th>
                        <th>Product</th>
                        <th>Total Stock</th>
                    </tr>
                </thead>
                <tbody>

                {
                    data.proformaItem.map(data => 

                            <tr>
                                <td>
                                    {stock[0]}{console.log(stock[0])}
                                </td>
                                <td>
                                    {stock[1]}{console.log(stock[1])}
                                </td>
                                <td>
                                    {stock[2]}{console.log(stock[2])}
                                </td>
                                <td>
                                    {data.categoryDescription}
                                </td>
                                <td>
                                    {data.productDescription}
                                </td>
                            </tr>
                    )
                }

                </tbody>
            </table>
      </div>
    )
  }
}

export default App;
